script: |
  super -f text -I q5667.spq | sort > q5667.out

inputs:
  - name: q5667.spq
    data: |
      SELECT - col0 * + tab1.col2 FROM tab1 (FORMAT parquet) WHERE NOT ( NULL NOT BETWEEN + col0 * col0 * col2 AND ( col0 * - col2 * - col0 ) ) AND NULL NOT IN ( col2 );
  - name: tab1

outputs:
  - name: q5667.out
    data: |
